"""
Shared k-mers Problem: Given two strings, find all their shared k-mers.

Input: An integer k and two strings.
Output: All k-mers shared by these strings, in the form of ordered pairs (x, y) corresponding to starting positions of these k-mers in the respective strings.

Sample Input:
3
AAACTCATC
TTTCAAATC

Sample Output:
(0, 4)
(0, 0)
(4, 2)
(6, 6)
"""
from string import maketrans

'''
    SyntenyBlocks(DotPlot, maxDistance, minSize)
        construct SyntenyGraph(DotPlot, maxDistance)
        find the connected components in SyntenyGraph(DotPlot, maxDistance)
        output connected components containing at least minSize nodes as candidate synteny blocks
'''

k = 17
dna1 = ''
dna2 = ''

#We color the point (x, y) red if the two genomes share a k-mer starting at respective positions x and y. 
#We color (x, y) blue if the two genomes have reverse complementary k-mers at these starting positions. 


def reverse_comp(Dna):
    a = 'ATCG'
    b = 'TAGC'
    reverseval = Dna.translate(maketrans(a,b))[::-1]
    return reverseval

def SharedKmers(k, dna1, dna2):
    dnadict = {}
    for i in range(len(dna1) - k + 1):
        if dna1[i:i+k] in dnadict:
            dnadict[dna1[i:i+k]].append(i)
        else:
            dnadict[dna1[i:i+k]] = [i]
    dn = []
    for j in range(len(dna2) - k + 1):
        if dna2[j:j+k] in dnadict:
            for seq in dnadict[dna2[j:j+k]]:
                dn.append([seq, j])
        elif reverse_comp(dna2[j:j+k]) in dnadict:
            for seq in dnadict[reverse_comp(dna2[j:j+k])]:
                dn.append([seq, j])
        #else: 
    return dn


if __name__ == "__main__":
    sharedkmers = SharedKmers(k, dna1, dna2)
    for lines in sharedkmers:
        print('(' + ', '.join(map(str, lines)) + ')')
